import logo from './logo.svg';
import './App.css';

function App() {
  return (
      <section class='main'>
          <article class='main-content'>
            <a href="/papildymas.html" class="main-link"><button class='main-button'><iconify-icon icon="uil:money-insert" class="main-icon"></iconify-icon>Papildyti sąskaitą</button></a>
            <a href="/isvedimas.html" class="main-link"> <button class='main-button'><iconify-icon icon="solar:cash-out-broken" class="main-icon"></iconify-icon>Išvesti pinigus</button></a>
            <a href="/pervedimas.html" class="main-link"><button class='main-button'><iconify-icon icon="fa6-solid:money-bill-transfer" class="main-icon"></iconify-icon>Pervesti pinigus į kitą sąskaitą</button></a>
        </article>
      </section>

  );
}

export default App;
